import React from "react";
import { useSelector } from "react-redux";
import style from "./style.module.css";

export const OrderDetail = () => {
  const totalAmount = useSelector((state) => state.basket.totalAmount);

  return (
    <div className={style.container}>
      <h2 className={style.h2}>Order details</h2>
      <div className={style.priceBox}>
        <p>Total</p>
        <p className={style.finalPrice}>{totalAmount}$</p>
      </div>
      <input className={style.input} type="tel" placeholder="Phone number" />
      <button className={style.button}>Order</button>
    </div>
  );
};
